	add("silhouette", "{\"term\":\"silhouette\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Basque\"], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027silhouette\u0027 from the name of {{w|Étienne de Silhouette}}, a French politician. His surname, in turn, is (gallicized) Basque\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An illustrated outline filled in with a solid color(s), usually only black, and intended to represent the shape of an object without revealing any other visual details; a similar appearance produced when the object being viewed is situated in relative darkness with brighter lighting behind it; a profile portrait in black, such as a shadow appears to be\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"I could see a \u0027\u0027silhouette\u0027\u0027 of a figure looking out from the window, but I couldn\u0027t tell if it was a man or a woman\", \"priority\":2}]}, \"synonyms\":{}}");

